package net.zdsoft.stutotality.data.service.impl;import net.zdsoft.basedata.service.impl.BaseServiceImpl;import net.zdsoft.framework.dao.BaseJpaRepositoryDao;import net.zdsoft.stutotality.data.dao.StutotalityHealthDao;import net.zdsoft.stutotality.data.entity.StutotalityHealth;import net.zdsoft.stutotality.data.entity.StutotalityHealthOption;import net.zdsoft.stutotality.data.service.StutotalityHealthOptionService;import net.zdsoft.stutotality.data.service.StutotalityHealthService;import org.apache.commons.collections.CollectionUtils;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.*;/** * stutotality_health  * @author  *  */@Service("stutotalityHealthService")public class StutotalityHealthServiceImpl extends BaseServiceImpl<StutotalityHealth,String> implements StutotalityHealthService{	@Autowired	private StutotalityHealthDao stutotalityHealthDao;	@Autowired	private StutotalityHealthOptionService stutotalityHealthOptionService;		@Override	protected BaseJpaRepositoryDao<StutotalityHealth, String> getJpaDao() {		return stutotalityHealthDao;	}	@Override	protected Class<StutotalityHealth> getEntityClass() {		return StutotalityHealth.class;	}	@Override	public List<StutotalityHealth> findHealthItemByUnitId(String unitId) {		List<StutotalityHealth> healthItemList = stutotalityHealthDao.findHealthItemByUnitId(unitId);		return healthItemList;	}	@Override	public List<StutotalityHealth> findHealthItemByUnitIdWithMaster(String unitId) {		List<StutotalityHealth> healthItemList = stutotalityHealthDao.findHealthItemByUnitId(unitId);		return healthItemList;	}	@Override	public void deleteByUnitId(String unitId) {		stutotalityHealthDao.deleteByUnitId(unitId);	}}